import { combineReducers } from "redux";

import stateUrl from "./Url/reducerUrl";
import stateLevelCompleted from './LevelCompleted/reducerLevelCompl';



const rootReducer = combineReducers({
    stateUrl,
    stateLevelCompleted,

})

export default rootReducer
